import "./LibraryBtn.css";


const LibraryBtn = () => {

    const plusImage = 'plusImag'

  return <div className="libraryBtn">
    <div className="plusBtn libraryBtnDiv">
        <div classname='plusImage'/>
    </div>
    <div className="nextbtn libraryBtnDiv"></div>
  </div>
};


export default LibraryBtn;
